import React from 'react';
import styled from 'styled-components/native';

import { TouchableOpacity, StyleSheet, Image, View, Text } from 'react-native';
import { Feather } from '@expo/vector-icons';

import Photo1 from '../assets/baby1.jpg'

const ExploreArticle = ({ navigation }) => {

    return (
        <>
            <Main>

                <View style={styles.overlayContainer}>
                    <View style={styles.overlay}>
                        <TouchableOpacity onPress={() => navigation.navigate('Explore')}>
                            <Image source={Photo1} style={styles.photo} />           
                            </TouchableOpacity>            
                            <Feather name="arrow-left" size={30} color="white" style={styles.overlayIcon} />



                        <Text style={styles.overlayText}> Hur ska man b√∂rja? </Text>
                        </View>


                </View>

            </Main>

        </>
    )
}

const styles = StyleSheet.create({
    photo: {
        height: 300,
        width: 375,
        shadowColor: '#202020',
        shadowOffset: { width: 0, height: 2 },
        shadowRadius: 2,
    },
    overlayContainer: {
        flexDirection: 'row',
    },
    overlay: {
        borderRadius: 20,
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: '#94A968',
        marginLeft: 6,
        marginRight: 6,
    },
    overlayText: {
        fontSize: 10,
        color: 'white',
        paddingTop: 7,
        paddingBottom: 7,
    },
    overlayIcon: {

    }

})



const Main = styled.View`
flex: 1;
background-color:#5A673E;
`


export default ExploreArticle;
